import React from "react";

const Lista = (props) => {
    return(
        <div>
            <label>{props.label}</label>

            <select required={props.obrigatorio}> 
                {props.itens.map(item => <option>{item}</option>)}
            </select>
        </div>
    )
}
export default Lista;
